window.bookSummaryJSON = "<p><b>Friendship is strained to its breaking point in this </b><b><i>Wall Street Journal</i></b><b> bestseller by Jeff Wheeler.</b></p> <p>When the emperor is assassinated, Sera Fitzempress is the noble most eligible to inherit the empire. Her upcoming marriage to the prince would cement her position. And as a champion for peace, Sera is the only promise of hope for staving off war between the worlds of Kingfountain and Muirwood. But standing between her and her enemies is just one devastating secret.</p> <p>Sera’s best friend, Cettie, a girl born of a lower class, has made a shattering discovery: her entire existence has been a lie. Now Cettie must give up the only life she’s known and fought for and leave behind the man she loves to stop Sera’s wedding. For this discovery could bring the whole of Kingfountain to ruin.</p> <p>As Cettie struggles to determine her true loyalties and loves, her allies fall to wicked plots, and she becomes increasingly alone on her journey to a destiny she never wanted - one that could ignite an unstoppable war.</p>"; 
